import './App.css';
import Cards from './components/Cards.jsx';
import characters, { Rick } from './data.js';
import SearchBar from './components/SearchBar'
import Nav from './components/Nav.jsx'

function App() {
   return (
      <div className='App'>
         <SearchBar />
         <Cards characters={characters} />
      </div>
   );
}

export default App;
